import { Grid, Typography } from '@mui/material';
import React from 'react';

const Skills = () => {
  return (
    <Grid
      container
      sx={{
        position: 'relative',
        backgroundColor: 'rgb(30, 30, 30)',
        px: { md: 10, xs: 0 },
        mt: { md: -2, xs: -5 },
        height: { xs: '80vh', md: '90vh' },
        overflow: 'hidden',
        display: 'flex',
        justifyContent: 'center',
        // alignItems: 'center', for straight height
      }}
    >
      <Typography
        variant="h2"
        sx={{
          color: 'white',
          textAlign: 'center',
          fontWeight: 600,
          fontFamily: 'sans-serif'
        }}
      >
        What i do
      </Typography>
    </Grid>
  );
};

export default Skills;
